import logo from './logo.svg';
import './App.css';
import Footer from './components/Footer.js'
import Gallery from './components/Gallery.js'

function App() {
  return (
    <div className="App">
      <header className="App-header"></header>
      <Gallery></Gallery>
      <Footer></Footer>
    </div>
  );
}

export default App;
